document.addEventListener("DOMContentLoaded", function () {
  console.log("Consulta de creacin de Paquetes DOM cargado...");
  const parametrosBusqueda = localStorage.getItem("parametrosBusquedaPaquete");
  if (parametrosBusqueda) {
    const params = new URLSearchParams(parametrosBusqueda);
    const pSistema = params.get("pSistema") ?? "";
    const pUsuario = params.get("pUsuario") ?? "";
    const pOpcion = params.get("pOpcion") ?? "";
    const fechaIni = params.get("fechaIni") ?? "";
    const fechaFin = params.get("fechaFin") ?? "";
    const BodegaOrigen = params.get("BodegaOrigen") ?? "";
    const BodegaDestino = params.get("BodegaDestino") ?? "";
    const Aplicacion = params.get("Aplicacion") ?? "";
    
    
    //logica para el calendario:
    // 1. Asignacin inmediata al valor del input
    if (fechaIni) document.getElementById("fecha_ini").value = fechaIni;
    if (fechaFin) document.getElementById("fecha_fin").value = fechaFin;

      // 2. Esperar un instante para que Materialize inicialice y luego forzar el estado
          setTimeout(() => {
              // Forzar a los labels a subir
              M.updateTextFields();

              // Reinicializar los datepickers especficamente con la fecha guardada
              const inputs = document.querySelectorAll('.datepicker');
              inputs.forEach(input => {
                  const fechaGuardada = input.id === 'fecha_ini' ? fechaIni : fechaFin;
                  
                  if (fechaGuardada) {
                      // Crear objeto fecha (importante aadir la hora para evitar desfases de zona horaria)
                      const dateParts = fechaGuardada.split('-'); // Asumiendo YYYY-MM-DD
                      const d = new Date(dateParts[0], dateParts[1] - 1, dateParts[2]);

                      M.Datepicker.init(input, {
                          format: 'yyyy-mm-dd',
                          defaultDate: d,
                          setDefaultDate: true, // Esto obliga al calendario a mostrar la fecha
                          autoClose: true
                      });
                  }
              });
          }, 100);





    const para =
                "?pSistema=" +
                pSistema +
                "&pUsuario=" +
                pUsuario +
                "&pOpcion=" +
                pOpcion +
                "&fechaIni=" +
                fechaIni +
                "&fechaFin=" +
                fechaFin +
                "&BodegaOrigen=" +
                BodegaOrigen +
                "&BodegaDestino="+
                BodegaDestino+
                "&Aplicacion=" +
                Aplicacion;
    enviarDatosControlador(para);
  }



      const buscador = document.getElementById('txtBuscadorTabla');
    if (buscador) {
        buscador.addEventListener('keyup', function(e) {
            const texto = e.target.value.toLowerCase();
            
            // Filtramos sobre la data original
            const dataFiltrada = dataOriginal.filter(fila => {
                // Convierte todos los valores de la fila a string y busca el texto
                return Object.values(fila).some(valor => 
                    String(valor).toLowerCase().includes(texto)
                );
            });

            // Re-dibujamos la tabla con los resultados filtrados
            // Pasamos un segundo parmetro opcional para evitar que las observaciones se limpien o cambien
            armarTablaResultados(dataFiltrada, true); 
        });
    }

  cargarBodegas();
});


