function cargarParametros() {
  mostrarLoader();
  let pSistema = "WMS";
  let pUsuario = document.getElementById("hUsuario").value;
  let opc = document.getElementById('vistaResumida');
  let pOpcion = (opc && opc.checked) ? "R" : "DD";  
  let fechaIni = $("#fecha_ini").val();
  let fechaFin = $("#fecha_fin").val();
  let BodegaOrigen = document.getElementById("bodega").value;
  let BodegaDestino = document.getElementById("bodegaSelectPack").value;
  let Aplicacion = $("#Aplicacion").val() ? $("#Aplicacion").val().trim() : "";

  const params =
    "?pSistema=" +
    pSistema +
    "&pUsuario=" +
    pUsuario +
    "&pOpcion=" +
    pOpcion +
    "&fechaIni=" +
    fechaIni +
    "&fechaFin=" +
    fechaFin +
    "&BodegaOrigen=" +
    BodegaOrigen +
    "&BodegaDestino="+
    BodegaDestino+
    "&Aplicacion=" +
    Aplicacion;
  enviarDatosControlador(params);
}
function enviarDatosControlador(params) {
  // armarTablaResultados(paquetesCreadosArray);
  console.log("BUSQUEDA Paquete PARAMETROS\n " + params);
  localStorage.setItem("parametrosBusquedaPaquete", params);

  fetch(env.API_URL + "busquedadePaquetes" + params, myInit)
    .then((response) => response.json())
    .then((result) => {
      console.log('API: ');
      console.log(result);
      if (result.msg === "SUCCESS") {
        // ocultarLoader();
        paquetesCreadosArray = result.respuesta;
        if (result.respuesta.length != 0) {
          armarTablaResultados(paquetesCreadosArray);
          console.log("REsultados:");
          console.log(paquetesCreadosArray);
        } else {
          // ocultarLoader();
          Swal.fire({
            icon: "info",
            title: "Informacin",
            text: "No hay registros asignados para el usuario",
            confirmButtonColor: "#28a745",
          });          
        }
        document.getElementById("carga").innerHTML = "";
      } else {
        Swal.fire({
          icon: "error",
          title: "error",
          text: "Se registro un error en la aplicacin",
          confirmButtonColor: "#28a745",
        });
      }
    });
  ocultarLoader();
}
function cargarBodegas() {
  fetch(env.API_URL + "wmsmostarbodegasconsultaordencompra")
    .then((response) => response.json())
    .then((data) => {
      const bodegasSelect = document.getElementById("bodegaSelectPack");
      if (data.respuesta && Array.isArray(data.respuesta)) {
        // Limpiar las opciones existentes
        bodegasSelect.innerHTML =
          '<option value="" disabled selected>Seleccione una bodega</option>';

        // Agregar opciones nuevas
        data.respuesta.forEach((bodega) => {
          const option = document.createElement("option");
          option.value = bodega.BODEGA;
          option.textContent = bodega.NOMBRE;
          bodegasSelect.appendChild(option);
        });

        // Re-inicializar el select para aplicar los cambios
        M.FormSelect.init(bodegasSelect);
      } else {
        console.error("No se encontraron bodegas.");
      }
    })
    .catch((error) => console.error("Error al cargar las bodegas:", error));
}

function armarTablaResultados(data, esFiltro = false) {

  if (!esFiltro) {
        dataOriginal = data;
    }

    const tabla = document.getElementById('tblResultados');
    const tbody = document.getElementById("tblbodyResultados");
    const txtObservaciones = document.getElementById("observaciones");
    const cantidadLabel = document.getElementById("cantidadDeRegistros");

    if (!tabla || !tbody) return;

    const tableHeadRow = tabla.querySelector("thead tr");
    tableHeadRow.innerHTML = "";
    tbody.innerHTML = "";

    if (!data || data.length === 0) {
        if (cantidadLabel) cantidadLabel.textContent = "Registros: 0";
        if (txtObservaciones) txtObservaciones.value = "";
        return;
    }

    cantidadLabel.textContent = "Registros: " + data.length;

    // --- 1. LGICA DE OBSERVACIONES NICAS ---
    if (txtObservaciones && !esFiltro) {
        const refsUnicas = [...new Set(data
            .map(item => (item.REFERENCIA || item.referencia || "").toString().trim())
            .filter(val => val !== "" && val.toLowerCase() !== "comentario" && val.toLowerCase() !== "null")
        )];
        txtObservaciones.value = refsUnicas.join(" | ");
        M.textareaAutoResize(txtObservaciones);
        M.updateTextFields();
    }
    // if (txtObservaciones) {
    //     // Extraemos todos los valores de la columna REFERENCIA
    //     const refsFiltradas = data
    //         .map(item => {
    //             const val = item.REFERENCIA || item.referencia;
    //             return val ? val.toString().trim() : "";
    //         })
    //         .filter(val => 
    //             val !== "" && 
    //             val.toLowerCase() !== "comentario" && 
    //             val.toLowerCase() !== "null"
    //         );

    //     // Al usar Set() eliminamos automticamente todos los duplicados
    //     const refsUnicas = [...new Set(refsFiltradas)];

    //     // Unimos con un espacio o coma si hay ms de una distinta, 
    //     // pero segn tu instruccin, si es la misma siempre, solo saldr una vez.
    //     txtObservaciones.value = refsUnicas.join(" | "); 
        
    //     // Refrescar Materialize para que el label no choque
    //     M.textareaAutoResize(txtObservaciones);
    //     M.updateTextFields();
    // }

    // --- 2. FILTRAR COLUMNAS PARA LA TABLA (Excluir REFERENCIA) ---
    const columnas = Object.keys(data[0]).filter(col => col.toUpperCase() !== "REFERENCIA");

    // --- 3. CONSTRUIR ENCABEZADOS CON CLIC PARA ORDENAR ---
    columnas.forEach(columna => {
        const th = document.createElement("th");
        th.className = "lineasocstyle";
        th.style.cursor = "pointer";
        
        let indicador = (columna === columnaOrdenada) ? (ordenAscendente ? " " : " ") : "";
        th.textContent = columna.replace(/_/g, " ").toUpperCase() + indicador;

        th.onclick = () => {
            if (columnaOrdenada === columna) {
                ordenAscendente = !ordenAscendente;
            } else {
                columnaOrdenada = columna;
                ordenAscendente = true;
            }
            
            // Ordenamiento lgico
            const dataOrdenada = [...data].sort((a, b) => {
                let valA = a[columna] ?? "";
                let valB = b[columna] ?? "";

                if (!isNaN(valA) && !isNaN(valB) && valA !== "" && valB !== "") {
                    return ordenAscendente ? valA - valB : valB - valA;
                }
                return ordenAscendente 
                    ? String(valA).localeCompare(String(valB))
                    : String(valB).localeCompare(String(valA));
            });

            armarTablaResultados(dataOrdenada);
        };
        tableHeadRow.appendChild(th);
    });

    // --- 4. CONSTRUIR CUERPO DE LA TABLA ---
    data.forEach((item) => {
        const row = document.createElement("tr");
        
        row.onclick = () => {
            const idRef = item.TRASLADO || item.CONTENEDOR || "";
            if (idRef) irAlDetalle(idRef);
        };

        columnas.forEach(columna => {
            const td = document.createElement("td");
            td.className = "resultados-Tabla";
            let valor = item[columna] ?? "";
            td.textContent = valor;

            // Resaltar diferencias
            if (columna.toUpperCase().includes("DIF")) {
                const num = parseFloat(valor);
                if (num < 0) td.style.color = "red";
                else if (num > 0) td.style.color = "green";
                if (num !== 0) td.style.fontWeight = "bold";
            }
            row.appendChild(td);
        });
        tbody.appendChild(row);
    });
    armaTotales(data, columnas);
}

function irAlDetalle(Aplicacion) {
  localStorage.setItem("ConsecutivoPaquete", Aplicacion);
  window.location.href = "detalle_paquete.html";
}
function limpiarResultadoGeneral() {
  const tabla = document.getElementById("tblResultados");
  const resultadoPaginador = document.getElementById("resultadoPaginador");
  const totalRegistros = document.getElementById("cantidadDeRegistros");
  const bodegaDestino = document.getElementById("bodegaSelectPack");

  // Limpiar el contenido del paginador si existe
  if (resultadoPaginador) {
    resultadoPaginador.innerHTML = "";
  }

  if (bodegaDestino) {
    bodegaDestino.innerHTML = "";
  }
  // Limpiar el contenido de totalRegistros si existe
  if (totalRegistros) {
    totalRegistros.innerHTML = "";
  }

  // Limpiar el contenido del tbody de la tabla si la tabla existe
  if (tabla) {
    let tbody = tabla.querySelector("tbody");
    if (tbody) {
      tbody.innerHTML = "";
    }
  }
  localStorage.removeItem("SearchParameterFlag");
  localStorage.removeItem("parametrosBusquedaPaquete");
}

/**
 * Calcula y renderiza la fila de totales dinmicamente para columnas especficas
 * @param {Array} data - El JSON con los datos
 * @param {Array} columnas - Las columnas que se estn mostrando (sin REFERENCIA)
 */
function armaTotales(data, columnas) {
    const tabla = document.getElementById('tblResultados');
    if (!tabla) return;

    // 1. Eliminar tfoot si ya existe para evitar duplicados
    let tfoot = tabla.querySelector("tfoot");
    if (tfoot) tfoot.remove();

    tfoot = document.createElement("tfoot");
    const row = document.createElement("tr");
    
    // Estilo para resaltar la fila de totales
    row.style.backgroundColor = "#86bfc4ff"; // Un verde muy claro (Materialize teal lighten-5)
    row.style.fontWeight = "bold";
    row.style.borderTop = "2px solid #26a69a";   

    // 2. Definir las columnas exactas que queremos sumar
    const columnasASumar = ["CANT_PREPARADA", "CANT_SOLICITADA", "CANT_VERIFICADA", "DIFERENCIA", "DIF"];

    columnas.forEach((columna, index) => {
        const td = document.createElement("td");
        td.className = "resultados-Tabla";
         td.style.fontSize = "16px";

        // Verificamos si la columna actual est en nuestra lista de permitidas
        const nombreCol = columna.toUpperCase();
        const debeSumar = columnasASumar.some(c => c.toUpperCase() === nombreCol);

        if (debeSumar) {
            const total = data.reduce((acc, item) => {
                const val = parseFloat(item[columna]) || 0;
                return acc + val;
            }, 0);
            
            // Si el total tiene decimales, podras usar .toFixed(2), si no, dejarlo as
            td.textContent = Number.isInteger(total) ? total : total.toFixed(2);
        } else {
            // En la primera columna ponemos la etiqueta "TOTALES"
            if (index === 0) {
                td.textContent = "TOTALES";
                td.style.textAlign = "left";
                td.style.paddingLeft = "15px";
               
            } else {
                td.textContent = "";
            }

        }
        row.appendChild(td);
    });

    tfoot.appendChild(row);
    tabla.appendChild(tfoot);
}